import React, { Component } from "react";

export default class Rem extends Component {

    mostrarResumen = () => {
        return (
            <div className="rem">
                <h2>Resumen de la cotización</h2>
                <p>Modelo: </p>
                <p>Año: </p>
                <p>Plan: </p>
            </div>
        )
    }

    render() {
        return (
            <React.Fragment>
                {this.mostrarResumen()}
            </React.Fragment>
        );
    }
}
